import React from "react";
import { render } from "react-dom";
import Timeline from "react-visjs-timeline";
import moment from "moment";
import "./styles.css";
import data from './data'

const options = {
  width: "100%",
  height: "90vh",
  showMajorLabels: true,
  showCurrentTime: true,
  zoomMin: 1000000,
  type: "range",
  orientation: "top",
  stack: true,
  editable: true,
};

const groups = [

  // { content: "Formula E", id: "Formula E", value: 1, className: "openwheel" },


  // { content: "GP2", id: "IndyCar", value: 2, className: "openwheel" },

  // {
  //   content: "MotoAmerica",
  //   id: "MotoAmerica",
  //   value: 9,
  //   className: "motorcycle"
  // },




  // {
  //   id: 1,
  //   content: "AUDI",
  //   items: ["The Audi"],
  // },

  // {
  //   id: 2,
  //   content: "BMW",
  //   items: ["Interviews"],
  // },

  // {
  //   id: 3,
  //   content: "APPLE",
  //   items: [" Roadmap"],
  // },
];

const items = [];
groups.forEach((group) => {
  group.items.forEach((item) => {
    items.push({
      id: items.length,
      start: moment().startOf("day").add(items.length, "days"),
      end: moment()
        .startOf("day")
        .add(items.length + 5, "days"),
      content: item,
      group: group.id,
    });
  });
});

export default function App() {
  return (
    <Timeline initialItems={data} initialGroups={groups} options={options} />
  );
}
